import { Link } from "react-router-dom"
import "../"
const NavBar = () => {
    return(
        <nav>
            <div className="containerNavBar">
                <Link to="home">Home</Link>
                <Link to="mangalist">Manga List</Link>
            </div>
        </nav>
    )
}

export default NavBar
